column8:
AIRCORNO エアコルノLED電球GU10<br>
<br>
ヨーロッパ規格のGU10口金にピッタリのサイズ。<br>
ハロゲン電球約35W相当の電球の明るさで約5Wと節電対策。<br>
光色は暖かな電球色。<br>
_<br>
【特徴】<br>
・消費電力5Wの省エネで長寿命なLED電球。<br>
・GU10口金にピッタリ。<br>
・明るさはハロゲン電球35W相当。<br>
・光色は電球色(420lm)。<br>
・演色指数80高演色<br>
・広配光、約36度<br>
<br>
AIRCORNOシリーズから省エネ・長寿命のLED電球が発売。<br>
IKEA(イケア)などで販売しているヨーロッパ規格の電球対応<br>
演色指数は80で高演色。<br>
配光角はGU10の中でワイドな約36度で広く明るく照らします。<br>
間接照明の電球にもオススメです。<br>
<br>
【仕様】<br>
■消費電力：約5W<br>
■口金：GU10<br>
■サイズ：約H54×Φ49mm<br>
■重さ：約57g<br>
■配光角：約36度<br>
■明るさ：約420lm<br>
■光色：電球色(3000k)<br>
■平均演色評価数：Ra80<br>
■屋内用:100-240V 50/60Hz<br>
<br>
【使用できない環境】<br>
※誘導灯・非常用照明器具、HIDランプ器具では絶対に使用しないでください。<br>
※周囲温度が40℃を超える場所では使用しないでください<br>
※水滴がかかる場所では使用しないでください。<br>
※硫黄成分を含む温泉地や工場、酸などの腐食性ガス発生のある環境、塩害をうける環境では使用できません。<br>
<br>
【使用できない器具】<br>
※調光・調色機能付き器具<br>
※ホタルスイッチ<br>
　(消灯時にスイッチが光るもの/電球が薄く光ったままの状態になる場合があります。)<br>
※電球と反射板の隙間が近い器具<br>
※センサー付きの器具<br>
※断熱施工器具（SB、SGI、SG形表示器具など）<br>
※直流電源<br>
※電子点滅器には使用しないでください。<br>
※次のような調光器と組み合わせて使用しないでください。<br>
■人感センサ付調光器<br>
■リモコン式調光器<br>
■段調光形調光器<br>
■定格1000W以上の調光器<br>
■記憶式調光器<br>
■電球用以外の調光<br>
<br>
◆注意事項◆<br>
※電球を長時間直視するのはおやめください。<br>
※ラジオやテレビなどの音響および映像機器の近くで点灯しますと雑音が入る場合があります。<br>
※寸法、熱的、その他の状況（リモコン機能のついた器具など）により使用できない場合があります。<br>
※器具の種類によっては、ちらつく場合があります。<br>
※LED素子にはバラツキがあるため、同じ商品でも光色や明るさが異なることがあります。<br>
※明るさ、光の広がり方は電球と異なります。<br>
※取付・取り外しは必ず電源を切った状態で行い、電源を入れた状態や電源を切った後しばらくの間は、電球が熱いので触れないでください。感電、やけどの原因となります。 <br>
